"276501":{"id":"276501","name":"A Vida Secreta dos Animais","slug":"a-vida-secreta-dos-animais","original_title":"The Secret Lives of Animals","overview":"Conheça técnicas inteligentes e criativas que os animais usam para enfrentar os desafios mais extraordinários da vida, como deixar seus lares ou encontrar um parceiro.","first_air_date":"2024-12-18","episode_run_time":0,"vote_average":7.8,"number_of_seasons":1,"number_of_episodes":10,"created_by":[],"production_companies":["BBC Studios Natural History Unit"],"genres":["Documentário"],"certification":"10","backdrop_path":"https://image.tmdb.org/t/p/original/8uSALUeWbRN2CjZXNhW65RQf2nG.jpg","poster_path":"https://image.tmdb.org/t/p/original/k7cB1kI1bJtn0UM5Lsg0MdZcfYJ.jpg","cast":["Hugh Bonneville"],"trailer":"Mm9fKOYbzSQ","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/uH3uuCHmfeJoG8b2mgK2jJ5CzKr.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/uH3uuCHmfeJoG8b2mgK2jJ5CzKr.jpg","air_date":"2024-12-18","episode_count":10,"overview":"N/A","vote_average":8,"episodes":{"1":{"name":"Saindo de Casa","overview":"Um lobo-marinho sai de casa cedo demais e enfrenta uma batalha épica contra o oceano. Um lagarto e um peixe desafiam a gravidade para chegar ao próximo destino.","air_date":"2024-12-18","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/dYPYN0HVbaPLX9ApgL3mxYfQIfO.jpg","vote_average":8},"2":{"name":"Criando uma Família","overview":"Para alimentar os filhotes, uma chimpanzé usa gravetos para pescar cupins. Suricatos se ajudam para fugir do perigo.","air_date":"2024-12-18","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/qpND72IjJUpUhBcN2txcp1QHTjI.jpg","vote_average":8},"3":{"name":"Autoproteção","overview":"Uma rã engana uma cobra desaparecendo em plena luz do dia. Um polvo fêmea encontra uma nova armadura. Uma aranha constrói uma isca deslumbrante.","air_date":"2024-12-18","runtime":31,"still_path":"https://image.tmdb.org/t/p/original/mpVCDuiTSKKU4KIXPCU1sRQwwOo.jpg","vote_average":8},"4":{"name":"Construindo uma Casa","overview":"Uma cacatua usa um método único para mostrar à parceira que encontrou um bom lugar para um ninho. Um urso-do-sol prepara uma cama no topo das árvores.","air_date":"2024-12-18","runtime":32,"still_path":"https://image.tmdb.org/t/p/original/15AcTgYK5b8ksc1Wv6dUN9OjDzs.jpg","vote_average":0},"5":{"name":"Encontrando Alimento","overview":"Golfinhos dominam a arte de pescar em terra firme. Um louva-a-deus se disfarça para pegar suas presas. Gralhas usam carros para quebrar suas nozes.","air_date":"2024-12-18","runtime":29,"still_path":"https://image.tmdb.org/t/p/original/6YVsjRZpMl1NC0PUe2umBXFMXgb.jpg","vote_average":0},"6":{"name":"A Arte do Fingimento","overview":"Para afastar predadores, corujas e lagartas imitam cobras. Uma aranha realiza uma fuga de mestre.","air_date":"2024-12-18","runtime":27,"still_path":"https://image.tmdb.org/t/p/original/6z4W2GbSEoLUKD5HvvcXMn9J6OP.jpg","vote_average":0},"7":{"name":"Fazendo Amizades","overview":"Macacos fazem amizade usando uma abordagem incomum: colocando um dedo no nariz um do outro. Formigas constroem pontes com seus corpos para transportar comida.","air_date":"2024-12-18","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/2ywBpuzpC2clGNdWl9Wbws9pVVf.jpg","vote_average":0},"8":{"name":"Encontrando um Parceiro","overview":"Pássaros dançam juntos em um lago na Califórnia e baleias entram em uma competição por uma parceira no Pacífico.","air_date":"2024-12-18","runtime":26,"still_path":"https://image.tmdb.org/t/p/original/mPkOXfAupVEN8DK9Lvm66WMag8Z.jpg","vote_average":0},"9":{"name":"Aperfeiçoando seu Talento","overview":"No outback, um canguru vai para a escola de luta. Um macaco-caranguejeiro consegue um banquete de frutos do mar. Uma filhote de orangotango escala alturas impressionantes.","air_date":"2024-12-18","runtime":28,"still_path":"https://image.tmdb.org/t/p/original/tsade11osvKT1ehzrhuAqJAZXJu.jpg","vote_average":0},"10":{"name":"Envelhecendo","overview":"Um babuíno idoso mostra seu lado mais carinhoso. Uma elefanta do deserto lidera a busca por água. Uma tartaruga cansada embarca em uma migração épica.","air_date":"2024-12-18","runtime":24,"still_path":"https://image.tmdb.org/t/p/original/rk5tpWqUs799IAu8Dq2bbQhAcZL.jpg","vote_average":0}}}}},
